import React from 'react';
import logo from './logo.svg';
import style from 'styled-components';
import './App.css';

const Wrapper = style.div`

  background-color: #232323;
  height: 100vh;
  width: 100vw;

`;

const LandingTitle = style.h1`

  background-color: white;
  font-size: 96px;

`;

function App() {
  return (
      <Wrapper>
        <LandingTitle>
          The Shoppies
        </LandingTitle>
      </Wrapper>
  );
}

export default App;
